-- ----------------------------
-- Table structure for driving_monitor
-- ----------------------------
DROP TABLE IF EXISTS `driving_monitor`;
CREATE TABLE `driving_monitor` (
  `id` bigint(2) NOT NULL COMMENT '唯一标识',
  `company_id` bigint(2) NOT NULL COMMENT '公司id',
  `driver_id` bigint(2) NOT NULL COMMENT '司机ws_open_id',
  `device_serial_no` varchar(50) NOT NULL COMMENT '设备序列号',
  `code` tinyint(1) NOT NULL COMMENT '行为编号',
  `type` tinyint(4) NOT NULL COMMENT '行为类型',
  `tired_value` tinyint(1) NOT NULL COMMENT '疲劳指数',
  `level` tinyint(1) NOT NULL COMMENT '行为级别',
  `speed` int(1) NOT NULL COMMENT '当时速度',
  `path` varchar(255) NOT NULL COMMENT '抓拍文件保存路径',
  `record_type` tinyint(1) NOT NULL DEFAULT '10' COMMENT '保存文件类型：10：图片，20：视频',
  `location_lat` varchar(50) NOT NULL COMMENT '定位：维度',
  `location_lng` varchar(50) NOT NULL COMMENT '定位：经度',
  `location_time` varchar(10) NOT NULL COMMENT '定位时间',
  `create_time` varchar(10) NOT NULL COMMENT '创建时间',
  `update_time` varchar(10) NOT NULL COMMENT '更新时间',
  `del_flg` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除位',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

